import React from 'react';
import feat from '../images/feat.png'
const Aboutus = () => {
    return (
        <>
        <div className="py-4">
            <div>
                <img src={feat} alt="feat" />
            </div>
        </div>
        </>
    );
};

export default Aboutus;
